import React from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Grid,
  IconButton,
  InputAdornment,
  Snackbar,
  Alert,
  LinearProgress
} from '@mui/material';
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';

export default function RegisterForm({ onClose, onRegisterSuccess }) {
  const [mostrarClave, setMostrarClave] = React.useState(false);
  const [formData, setFormData] = React.useState({
    nombre: '',
    apellido: '',
    correo: '',
    telefono: '',
    documento: '',
    contraseña: '',
    confirmar: ''
  });
  const [errores, setErrores] = React.useState({});
  const [registroExitoso, setRegistroExitoso] = React.useState(false);

  const validar = () => {
    const newErrors = {};
    const correoRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    const telRegex = /^[0-9]{7,}$/;

    if (!formData.nombre.trim()) newErrors.nombre = 'Este campo es obligatorio';
    if (!formData.apellido.trim()) newErrors.apellido = 'Este campo es obligatorio';
    if (!formData.correo || !correoRegex.test(formData.correo))
      newErrors.correo = 'Correo no válido';
    if (!formData.telefono || !telRegex.test(formData.telefono))
      newErrors.telefono = 'Teléfono inválido';
    if (!formData.documento.trim()) newErrors.documento = 'Debe indicar tipo y número de documento';
    if (!formData.contraseña || formData.contraseña.length < 6)
      newErrors.contraseña = 'Mínimo 6 caracteres';
    if (formData.confirmar !== formData.contraseña)
      newErrors.confirmar = 'Las contraseñas no coinciden';

    setErrores(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const evaluarFortaleza = (clave) => {
    if (clave.length >= 10 && /[A-Z]/.test(clave) && /\d/.test(clave)) return 100;
    if (clave.length >= 8 && /\d/.test(clave)) return 60;
    if (clave.length >= 6) return 30;
    return 10;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validar()) {
      setRegistroExitoso(true);
      if (onRegisterSuccess) onRegisterSuccess();
      if (onClose) onClose();
      // Simulación de guardado
      console.log('Datos registrados:', formData);
    }
  };

  return (
    <Box
      component="form"
      onSubmit={handleSubmit}
      noValidate
      sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}
      role="form"
      aria-labelledby="titulo-registro"
    >
      <Typography id="titulo-registro" variant="h5" sx={{ fontWeight: 'bold' }}>
        Registro
      </Typography>

      {/* Sección: Datos personales */}
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6}>
          <TextField
            name="nombre"
            label="Nombre"
            value={formData.nombre}
            onChange={(e) => setFormData({ ...formData, nombre: e.target.value })}
            autoComplete="given-name"
            fullWidth
            error={!!errores.nombre}
            helperText={errores.nombre}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            name="apellido"
            label="Apellido"
            value={formData.apellido}
            onChange={(e) => setFormData({ ...formData, apellido: e.target.value })}
            autoComplete="family-name"
            fullWidth
            error={!!errores.apellido}
            helperText={errores.apellido}
          />
        </Grid>
      </Grid>

      {/* Sección: Contacto */}
      <TextField
        name="correo"
        label="Correo electrónico"
        value={formData.correo}
        onChange={(e) => setFormData({ ...formData, correo: e.target.value })}
        autoComplete="email"
        fullWidth
        error={!!errores.correo}
        helperText={errores.correo}
      />

      <TextField
        name="telefono"
        label="Teléfono"
        value={formData.telefono}
        onChange={(e) => setFormData({ ...formData, telefono: e.target.value })}
        autoComplete="tel"
        fullWidth
        error={!!errores.telefono}
        helperText={errores.telefono}
      />

      <TextField
        name="documento"
        label="Tipo y número de documento"
        value={formData.documento}
        onChange={(e) => setFormData({ ...formData, documento: e.target.value })}
        fullWidth
        error={!!errores.documento}
        helperText={errores.documento}
      />

      {/* Sección: Credenciales */}
      <TextField
        name="contraseña"
        label="Contraseña"
        type={mostrarClave ? 'text' : 'password'}
        value={formData.contraseña}
        onChange={(e) => setFormData({ ...formData, contraseña: e.target.value })}
        autoComplete="new-password"
        fullWidth
        error={!!errores.contraseña}
        helperText={errores.contraseña || 'Mínimo 6 caracteres'}
        InputProps={{
          endAdornment: (
            <InputAdornment position="end">
              <IconButton
                onClick={() => setMostrarClave(!mostrarClave)}
                aria-label={mostrarClave ? 'Ocultar contraseña' : 'Mostrar contraseña'}
              >
                {mostrarClave ? <VisibilityOffIcon /> : <VisibilityIcon />}
              </IconButton>
            </InputAdornment>
          )
        }}
      />
      <LinearProgress
        variant="determinate"
        value={evaluarFortaleza(formData.contraseña)}
        sx={{ height: 8, borderRadius: 5 }}
        aria-label="Indicador de fortaleza de contraseña"
      />

      <TextField
        name="confirmar"
        label="Confirmar contraseña"
        type="password"
        value={formData.confirmar}
        onChange={(e) => setFormData({ ...formData, confirmar: e.target.value })}
        fullWidth
        error={!!errores.confirmar}
        helperText={errores.confirmar}
        autoComplete="new-password"
      />

      {/* Botones de acción */}
      <Box sx={{ display: 'flex', gap: 2 }}>
        <Button type="submit" variant="contained" color="primary" fullWidth>
          Registrarse
        </Button>
        <Button onClick={onClose} variant="outlined" color="secondary" fullWidth>
          Cancelar
        </Button>
      </Box>

      {/* Confirmación visual */}
      <Snackbar
        open={registroExitoso}
        autoHideDuration={4000}
        onClose={() => setRegistroExitoso(false)}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert severity="success" variant="filled" onClose={() => setRegistroExitoso(false)}>
          ¡Registro exitoso! Bienvenido.
        </Alert>
      </Snackbar>
    </Box>
  );
}
